let bomber1 = field => {
    if(field.length == 0){
        return 0
    }
    let storageData = new Array(field.length).fill([])
    storageData = storageData.map(v => 
        new Array(field[0].length).fill([])) 
    for(let ind = 0; ind < storageData.length; ind++){
        for(let pos = 0; pos < storageData[0].length; pos++){
            storageData[ind][pos] = [-1, -1, -1, -1]
        }
    }
	
	//emptyField = []
  //  field.map((r, i) => r.map((v, p) => v == '0' ? emptyField.push([i, p]) : 1))
    
   // if(emptyField.length == 0){
   //     return 0
   // }
	
    const DIRECTION = [[-1, 0], [0, -1], [0, 1], [1, 0]]
    
    checkInField = ([x, y]) => x >= 0 && x < field.length 
                              && y >= 0 && y < field[0].length
    
    dp = ([i, p], direct) =>{
        if(direct > -1 && storageData[i][p][direct] > -1){
            return storageData[i][p][direct]
        }
        
        if(field[i][p] == '0' || field[i][p] == 'E'){
            let addition = field[i][p] == 'E' ? 1 : 0
            if(direct > -1){
                let v = DIRECTION[direct]
                let [x, y] = [v[0] + i, p + v[1]]
                if(checkInField([x, y])){
                    let result = dp([x, y], direct)
                    storageData[i][p][direct] = addition + result
                }else{
                    storageData[i][p][direct] = addition
                }
                
                return storageData[i][p][direct]
            }else{
                DIRECTION.map((v, ind) => {
                    let [x, y] = [v[0] + i, p + v[1]]
                    if(checkInField([x, y])){
                        let result = dp([x, y], ind)
                        storageData[i][p][ind] = addition + result
                    }else{
                        storageData[i][p][ind] = addition
                    }
                })
            }
        }else{
            storageData[i][p] = [0, 0, 0, 0]
        }
    
        return 0
    }
    
   // let max = 0
   // emptyField.map(v => {
   //     if(storageData[v[0]][v[1]][0] < 0){
   //         dp(v, -1) 
   //     }
   //     let tmp = storageData[v[0]][v[1]][0] + storageData[v[0]][v[1]][1] + storageData[v[0]][v[1]][2] + storageData[v[0]][v[1]][3]
  //      max = max < tmp ? tmp : max
  //  })
  //  return max
  
  

  let max = 0
    field.map((r, i) => r.map((v, p) => {
	if(v == '0'){
		if(storageData[i][p][0] < 0){
            dp([i, p], -1) 
        }
		let tmp = storageData[i][p][0] + storageData[i][p][1] + storageData[i][p][2] + storageData[i][p][3]
        max = max < tmp ? tmp : max
	}}))
    return max
}

let bomber = field => {
    
    if(field.length == 0){
        return 0
    }
    
    checkEnemies = ([x, y]) => {
        let count = 0
        let temp = x + 1
        while(temp <  field.length){
            if(field[temp][y] == 'W') break;
            else if(field[temp][y] == 'E')  count++;
            temp++
        }
        temp = x - 1
         while(temp >= 0){
            if(field[temp][y] == 'W') break;
            else if(field[temp][y] == 'E') count++;
            temp--
        }
        
        temp = y - 1
        while(temp >= 0){
            if(field[x][temp] == 'W') break;
            else if(field[x][temp] == 'E')  count++;
            temp--
        }
        
        temp = y + 1
        while(temp < field[0].length){
            if(field[x][temp] == 'W') break;
            else if(field[x][temp] == 'E')  count++;
            temp++
        }
        
        return count
    }
    
    let maxCount = 0
    for(let ind = 0; ind < field.length; ind++){
        for(let pos = 0; pos < field[0].length; pos++){
            if(field[ind][pos] == '0'){
                let count = checkEnemies([ind, pos])
                maxCount = maxCount > count ? maxCount : count
            }
        }
    }
    
    return maxCount
}

LEFT = 'LEFT';
RIGHT = 'RIGHT';
UP = 'UP';
DOWN = 'DOWN';
WALL = 'W';
ENEMY = 'E';
EMPTY = '0';

function bomber2(field) {
    const memo = {};
    
    function outOfBounds(r, c) {
        return r < 0 || r >= field.length || c < 0 || c >= field[0].length;
    }
    
    function step(r, c, dir) {
        const key = `${r},${c},${dir}`;
        if (memo[key] !== undefined) {
            return memo[key];
        } else if (outOfBounds(r, c)) {
            return 0;
        } else if (field[r][c] === WALL) {
            return 0;
        }
        
        let enemies = (field[r][c] === ENEMY) ? 1 : 0;
        
        switch (dir) {
            case UP:
                // enemies += step(r - 1, c + 0, dir);
				  enemies += step(r - 1, c + 0, dir);
                break;
            case DOWN:
                enemies += step(r + 1, c + 0, dir);
                break;
            case LEFT:
                enemies += step(r + 0, c - 1, dir);
                break;
            case RIGHT:
                enemies += step(r + 0, c + 1, dir);
                break;
        }

        memo[key] = enemies;
        return enemies;
    }
    
    let max = 0;
    
    for (let r = 0; r < field.length; r++) {
        for (let c = 0; c < field[0].length; c++) {
            if (field[r][c] === EMPTY) {
                max = Math.max(
                    max,
                    step(r, c, UP) + step(r, c, DOWN) + step(r, c, LEFT) + step(r, c, RIGHT));    
            }
        }
    }
    
    return max;
}
